import React, { Component } from 'react';
import { connect } from 'react-redux';
// import { push } from "connected-react-router";
// import * as actions from "../../redux/actions/actionTypes";
import HomeHeader from '../../containers/HomePage/HomeHeader';
import * as XLSX from "xlsx";
import pdfMake from "pdfmake/build/pdfmake";
import pdfFonts from "pdfmake/build/vfs_fonts";


class ExcelToPDF extends Component {

    // Base64 hình ảnh (Thay bằng logo hoặc QR code của bạn)
    logoBase64 =
        "data:image/png;base64,"; // (Rút gọn, thay bằng ảnh thực)

    handleFile = (event) => {
        const file = event.target.files[0];
        if (!file) return;

        const reader = new FileReader();
        reader.readAsBinaryString(file);
        reader.onload = (e) => {
            const data = e.target.result;
            const workbook = XLSX.read(data, { type: "binary" });

            const sheetName = workbook.SheetNames[0];
            const worksheet = workbook.Sheets[sheetName];

            const jsonData = XLSX.utils.sheet_to_json(worksheet, { header: 1 });

            if (jsonData.length < 2) {
                alert("File Excel không có dữ liệu hợp lệ!");
                return;
            }

            const headers = jsonData[0]; // Tiêu đề cột
            const records = jsonData.slice(1); // Dữ liệu

            this.generatePDF(headers, records);
        };
    };

    generatePDF = (headers, records) => {
        const pages = records.map((row, index) => ({
            table: {
                widths: ["auto", "*"],
                body: [
                    [
                        { image: this.logoBase64, width: 40, height: 40, margin: [0, 0, 10, 0] }, // Logo
                        {
                            text: [
                                { text: "Công ty cổ phần đầu tư và thương mại Hồng Phúc\n", fontSize: 7, bold: true, alignment: "center" },  // Căn giữa
                                { text: "TÀI SẢN CÔNG TY", fontSize: 9, bold: true, alignment: "center" }  // Căn trái
                            ],
                            lineHeight: 1.5, // Dãn dòng (Mặc định là 1)
                            fontSize: 7,
                            bold: true,
                            margin: [2, 2, 2, 2]
                        }, // Tiêu đề
                    ],
                    [
                        {
                            colSpan: 2, text: headers.map((header, colIndex) => `${header}: ${row[colIndex] || ""}`).join("\n"),
                            fontSize: 9,
                            margin: [0, 5, 0, 0],
                            lineHeight: 1.5, // Dãn dòng (Mặc định là 1)
                        },
                        {},
                    ],
                ],
            },
            margin: [5, 5, 5, 5], // Cách mép nhỏ lại
            ...(index > 0 ? { pageBreak: "before" } : {}),
        }));

        const docDefinition = {
            pageSize: { width: 226.8, height: 226.8 }, // 80mm x 80mm
            pageMargins: [2, 2, 2, 2], // Cách mép toàn trang
            content: pages,
            defaultStyle: {
                font: "Roboto",
            },
        };

        pdfMake.createPdf(docDefinition).download("Labels_80x80.pdf");
    };

    render() {
        return (
            <>
                <HomeHeader />
                <div style={{ textAlign: "center", padding: "20px" }}>
                    <h2 style={{ color: "#007BFF" }}>Chọn file Excel để tạo tem</h2>
                    <input type="file" accept=".xls,.xlsx" onChange={this.handleFile} />
                </div>
            </>

        );
    }
}

const mapStateToProps = state => {
    return {

    };
};

const mapDispatchToProps = dispatch => {
    return {

    };


};

export default connect(mapStateToProps, mapDispatchToProps)(ExcelToPDF);
